const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  console.log(ratings);
  return (
    <div className="rating">
      <span>
        <i class="fa-solid fa-star"></i>
      </span>
      <span> {text && text} </span>
    </div>
  );
};

